import React from "react";
import { Link } from "react-router-dom";
import { useState } from "react";

const Login=()=>{

    const [userMail,setUserMail]=useState()
    const [userPassword,setUserPassword]=useState()
    const [warningStyle,setWarningStyle]=useState({color:'red',display:'none'})

    const submitLogin=(e)=>{
        e.preventDefault()
        console.log(userMail)
        console.log(userPassword)
    }

    return(
        <>
            <div>LOG IN</div>
            <form>
                <label>Mail</label>
                <input type="email" placeholder="Enter email..." onChange={(e)=>setUserMail(e.target.value)} required/>
                <p style={warningStyle}>Email is not registered</p>
                <label>Password</label>
                <input type="password" placeholder="Enter password..." onChange={(e)=>setUserPassword(e.target.value)} required/>
                <p style={warningStyle}>Password is incorrect</p>
                <Link to='/Main'>
                <button onClick={submitLogin}>Log In</button>
                </Link>
            </form>
            <div>
                <Link to='/Forgotpassword'>
                    <p>Forgot password? create new password here...</p>
                </Link>
                <Link to='/Signup'>
                    <p>Don't have an account? Sign Up here...</p>
                </Link>
            </div>
        </>
    )
}

export default Login
